import React from "react";
import ReactDOM from "react-dom";

const flname = "ambarish bhagawati";
const date=window.Date
ReactDOM.render(
  <>
    <h1>My name is {flname}</h1>
    {date}
    <p>Random number {Math.random()} </p>
  </>,
  document.getElementById("root")
);
